import React from 'react';

function Appclass() {
  const { name, age } = { name: '홍길동', age: 23 };
  return (
    <div>
      <h3>이름 : {name}</h3>
      <h3>나이 : {age}</h3>
    </div>
  );
}

export default Appclass;
